	add("devil", "{\"term\":\"devil\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"ancient greek (to 1453)\", \"saterfriesisch\"], \"text\":\"From Middle english (1100-1500) {{m|enm|devil}}, {{m|enm|devel}}, {{m|enm|deovel}}, from Old english (ca. 450-1100) {{m|ang|dēofol}}, {{m|ang|dēoful}}, from earlier {{m|ang|dīobul||devil}}, ultimately from Ancient greek (to 1453) {{m|grc|διάβολος||accuser, slanderer}}, also as \u0026quot;Satan\u0026quot; (in Jewish/Christian usage, translating Biblical Hebrew {{m|he|שטן}}, \u0027satán\u0027), from {{m|grc|διαβάλλω||to slander}}, literally “to throw across”, from {{m|grc|διά||through, across}} + {{m|grc|βάλλω||throw}}. The Old English word was probably adopted under influence of Latin {{m|la|diabolus}} (itself from the Greek). Other Germanic languages adopted the word independently: compare Saterfriesisch {{m|stq|Düüwel||devil}}, West frisian {{m|fy|duvel||devil}}, Dutch {{m|nl|duivel||devil}}, Low German {{m|nds-de|Düvel||devil}}, German {{m|de|Teufel||devil}}, Danish {{m|da|djævel||devil}}, Swedish {{m|sv|djävul||devil}} (older: {{m|sv|djefvul}}, Old Swedish {{m|gmq-osw|diævul}}, Old Norse {{m|non|djǫfull}}).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A creature of hell\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the devil\u0027\u0027 \u0027or\u0027 \u0027\u0027the Devil\u0027\u0027) The chief devil; Satan\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The bad part of the conscience; the opposite to the angel\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027devil\u0027\u0027 in me wants to let him suffer\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A wicked or naughty person, or one who harbors reckless, spirited energy, especially in a mischievous way; usually said of a young child\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Those two kids are \u0027\u0027devils\u0027\u0027 in a toy store\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A thing that is awkward or difficult to understand or do\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"That math problem was a \u0027\u0027devil\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"What in the \u0027\u0027devil\u0027\u0027 is that?\u0027 \u0027What the \u0027\u0027devil\u0027\u0027 is that\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"She is having a \u0027\u0027devil\u0027\u0027 of a time fixing it\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"You can go to the \u0027\u0027devil\u0027\u0027 for all I care\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A person, especially a man; used to express a particular opinion of him, usually in the phrases \u0027\u0027poor devil\u0027\u0027 and \u0027\u0027lucky devil\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A dust devil\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"An evil or erring entity\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A barren, unproductive and unused area.\u0026lt;ref\u0026gt;Dictionary of Regional American English\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;[http://www.word-detective.com/030600.htm\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"devilstrip Word Detective: Tales from the berm]\u0026lt;/ref\u0026gt\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A dish, as a bone with the meat, broiled and excessively peppered; a grill with Cayenne pepper\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Sir Walter Scot\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Men and women busy in baking, broiling, roasting oysters, and preparing \u0027\u0027devils\u0027\u0027 on the gridiron\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"A machine for tearing or cutting rags, cotton, etc\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"A Tasmanian devil\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Joyce L. Markovics, \u0027Tasmanian Devil: Nighttime Scavenger\u0027 (page 8\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"The stories told by Harris and the other settlers only made people more afraid of the \u0027\u0027devils\u0027\u0027. In the 1800s, for example, workers at a wool company were scared that the devils would attack their sheep\", \"priority\":23}]}, \"synonyms\":{}}");

