	add("devon", "{\"term\":\"devon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of processed meat sausage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, \u0027The Bulletin\u0027, Issues 5953-5959, [http://books.google.com.au/books?id\u003dcBMYAQAAIAAJ\u0026amp;q\u003d%22devon%22+smallgoods+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22devon%22+smallgoods+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d_oI8T8fzOuTEmQXMztzYBw\u0026amp;redir_esc\u003dy page 23\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Initial suspicions pointed at both food and water, narrowing down after a while to fritz (\u0027\u0027devon\u0027\u0027, as it is known in some states), a popular, bland, processed meat\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, w:Greig H. G. Nelson, \u0027Sprays: A Collection of Verbal Touch-Ups\u0027, [http://books.google.com.au/books?id\u003dR-4M4Qj4UAEC\u0026amp;pg\u003dPA216\u0026amp;dq\u003d%22devon%22+smallgoods+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dwpI8T8bGFIf6mAXq1b3QBw\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22devon%22%20smallgoods%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 216\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Elsewhere the Roy Slaven signature range of smallgoods – marketed with the shout-out line, ‘Roy: still doing things with meat butchers only dream of!’ − has captured the imagination of an increasingly time-poor community looking for top-shelf short cuts in cuisine solutions. When I last looked, Roy had personally signed nearly 5.9 million salamis, chorizos and \u0027\u0027devon\u0027\u0027 logs this year\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Helen Greenwood, John Newton, \u0027Sydney 2010: More Than 450 Butchers, Bakers, Food Stores and Chocolate Makers\u0027, [http://books.google.com.au/books?id\u003dXuEwx909jGYC\u0026amp;pg\u003dPT226\u0026amp;dq\u003d%22devon%22+smallgoods+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d_oI8T8fzOuTEmQXMztzYBw\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22devon%22%20smallgoods%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"One of our firm favourites both for the quality and the taste of Ricky Roessler′s smallgoods – and the sheer joy of shopping here. No \u0027\u0027devon\u0027\u0027 or pastrami, though, just plenty of bratwurst\", \"priority\":9}]}, \"synonyms\":{}}");

	add("devoir", "{\"term\":\"devoir\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027deveir\u0027 (French. French|devoir\u0027), from Latin \u0027debere\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Duty, business; something that one must do\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"vol.1, p.149\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"he imprint not so much in his schollers mindwhere \u0027Marcellus\u0027 died, as because he was unworthy of his \u0027\u0027devoire\u0027\u0027 he died there\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1787\u0027\u0027, Winifred Marshall Gales, \u0027The History of Lady Emma Melcombe and her family\u0027, vol.3. p.155\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I should have long ere this paid my devoirs to the inhabitants of Raymond Castle\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1885\u0027\u0027, Sir Richard Burton, \u0027The Book of the Thousand Nights and a Night\u0027, vol.1\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Then quoth the portress to the mistress of the house, \u0026quot;O my lady, arise and go to thy place that I in turn may do my \u0027\u0027devoir\u0027\u0027.\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, \u0027Sebastian\u0027, Faber \u0026amp; Faber 2004 (\u0027Avignon Quintet\u0027), p.1057\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"That is the little bit of essential information which enables us to complete our \u0027\u0027\u0027devoir\u0027\u0027\u0027 – without it we are just ordinary people, dispossessed, taken unawares: the original sin\", \"priority\":9}]}, \"synonyms\":{}}");

